import React from "react";
import Header from "../components/Header";
import "./Resume.scss"
import resume from "../imgs/colbe-roberson-resume-41024_1.jpg"

export default function Resume() {
    return (
        <div className="resume mx-auto mb-5" id="resume">
            <Header title={"Resume"} caption={"My resume.  Ready and available for download."} />
            <a href="/colbe-roberson-resume.pdf" download target="_blank"><div class="download-button text-center mx-auto mb-3">Download</div></a>
            <img className="mx-auto resume-img" src={resume} />
        </div>
    )
}
